        "description": "Ubicado en Playa del Inglés, Servatur Waikiki es un hotel totalmente renovado ideal para familias. Ofrece un servicio de todo incluido e instalaciones excepcionales: parque infantil, zona de chapoteo, espacio solo para adultos y zona de bienestar. Durante el día, organizamos actividades en grupo como voleibol, waterpolo y sesiones de fitness. Los más pequeños también pueden participar en un programa de animación infantil que incluye actividades, manualidades y deportes. Ofrecemos un completo programa diurno y nocturno con espectáculos profesionales. 511 habitaciones recientemente renovadas, luminosas y modernas equipadas con aire acondicionado. Las habitaciones están decoradas con colores vivos y frescos y tienen vistas a la piscina o a Playa del Inglés. Nuestro restaurante buffet despertará tus sentidos en un espacio de diseño moderno, fresco y luminoso. Te proponemos un viaje culinario alrededor del mundo bajo el nombre WorldCuisine. Temporadas de selecciones gastronómicas servidas en nuestro buffet y con show cooking. Una de las características clave del hotel es su bar piscina. No te pierdas nuestra amplia selección de snacks. El aburrimiento no es una opción en el Ukelele Bar gracias a nuestros espacios de entretenimiento. Parking temporalmente cerrado por reformas. Ten en cuenta que es posible que haya ruido debido a obras de renovación/construcción. ",
