        "description": "Rodeado de 12 000 m² de hermosos jardines, este hotel solo para adultos (16+) ofrece impresionantes vistas al océano Atlántico y a la exclusiva localidad turística de Costa Adeje. El cercano centro comercial de lujo está a solo 200 m, mientras que la exclusiva Playa del Duque se encuentra a 1 km. El restaurante buffet sirve comida internacional y mediterránea; hay un bar junto a la piscina y dos restaurantes a la carta especializados en cocina italiana y nikkei. El bar del vestíbulo goza de maravillosas vistas panorámicas. Para mayor comodidad, hay un servicio de transporte a Playa del Duque. ",
