        "description": "OKU Ibiza es un refugio balear en su forma más simple. Ubicado al suroeste de la isla, a pocos pasos de la hermosa Cala Gracio, OKU Ibiza es vibrante y tranquilo a la vez, reflejando el espíritu de la propia Isla Blanca. El entorno bohemio fusiona el interior con el exterior, con la piscina más grande de la isla, además de una segunda piscina que ofrece espacio y privacidad para que los huéspedes se relajen. Mostrando lo mejor de la cultura local, OKU Ibiza te invita a saborear una deliciosa cocina fusión en el OKU Restaurant, disfrutar de un cóctel recién preparado en la piscina o revitalizar cuerpo y mente en el spa y las áreas de bienestar. Nuestro acogedor escondite ibicenco te invita a descubrir tu espacio interior, sea lo que sea que eso signifique para ti. ",
